import React, { useState } from 'react';
import '../login.css'
import { Link } from 'react-router-dom';

const Login = () => {

    const [data,setdata]=useState({
      email: "",
      password: ""
    })

    const accept=(e)=>{
       const{ name, value}=e.target;

       setdata((pre)=>({
         ...pre,
         [name]: value
       }))
    }
        
     const handlesubmit=(e)=>{
         e.preventDefault();
         console.log(data)
     }


    return (
<div className="container">
  <h2>User Login</h2>
  <form action method="post" onSubmit={handlesubmit} encType="multipart/form-data">
    <div className="form-group">
      <label htmlFor="email">Email:</label>
      <input type="email" name="email" value={data.email} onChange={accept} className="form-control" id="email" placeholder="Enter you emaill.." required />
    </div>
    <div className="form-group">
      <label htmlFor="password">Password:</label>
      <input type="password" name="password" valuyeclassName="form-control" placeholder="Enter you password.." id="password" required />
    </div>
    <button type="submit" className="btn btn-primary">Login</button>&nbsp;<Link to='/signup'>Create a new account?</Link>
  </form>
</div>

        
    );
}

export default Login;
